description:
A guide to good and bad reading experiences created by Ken and his reading buddies.
<p>
<b><i><a href="mailto:reading@sidetrack.org">Write</a></i></b> and tell a little bit of the world what you think.&nbsp;

Mainly devoted to the "Bloody Big BATTLES!" wargames rules (BBB): scenarios being developed or playtested; games played; figures and terrain; and also to any of my other (non-BBB) wargaming activities.

BBB is published by SkirmishCampaigns, and is available from dealers such as:
Brigade Games; 
On Military Matters; 
Caliver Books; 
North Star Figures;
Tumbling Dice. For loads of good stuff related to BBB, check out the BBB group on groups.io:
https://groups.io/g/bloodybigbattles
